import React from 'react';
import Navigation from './components/Navigation';
import Header from './components/Header';
import Project from './components/Project';
import Footer from './components/Footer;'

function App() {
  return (
    <div>
    import Header from './components/Header';
import Project from './components/Project';
import Footer from './components/Footer;'
      <Navigation />
      <Project />
      <Footer />
    </div>
  );
}

export default App;
